select(2, ...).LoadData("APP_INFO","Global",[[return {version=403,lastSync=1587638242,message={id=0,msg=""},news={{title="TradeSkillMaster v4.9.32 Changelog",content="TSM v4.9.32 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* [Retail] Fixed issue with Sniper not working after recent client update<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1585141692,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-32-changelog/"},{title="TradeSkillMaster v4.9.31 Changelog",content="TSM v4.9.31 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* [Classic] TOC bump for 1.13.4<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1584050116,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-31-changelog/"},{title="TradeSkillMaster v4.9.30 Changelog",content="TSM v4.9.30 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from